import React from "react";
import "./Hero.css"; // we’ll also create this CSS file

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1>We Design Your Dream Office</h1>
        <p>Tailored interiors that inspire creativity and productivity.</p>
        <button className="btn-primary">Get Free Quote</button>
      </div>
    </section>
  );
};

export default Hero;
